        body {
            margin: 0;
            background: #0C0F1D;
            color: #f7f7f7;
            overflow: hidden;
        }

        .container {
            height: 100vh;
            background: linear-gradient(180deg, #0C0F1D 0%, #35524e 100%);
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 10px;
        }

        .content-box {
            background: #0C0F1D;
            border: 2px solid #97F0E5;
            border-radius: 24px;
            width: 100%;
            height: 98%;
            display: flex;
            justify-content: center;
            align-items: center;
            position: relative;
            overflow: hidden;
            padding: 0px;
        }

        .content {
            display: flex;
            font-family: 'PP Neue Bit', sans-serif;
            flex-direction: column;
            align-items: center;
            gap: 2rem;
            text-align: center;
            z-index: 1;
        }

        .walrus-logo {
            width: clamp(158px, 15vw, 187px);
            height: auto;
        }

        .title {
            font-family: 'PP Neue Bit', sans-serif;
            font-size: clamp(25px, 5vw, 68px);
            max-width: 600px;
            font-weight: bold;
        }

        .subtitle {
            font-family: 'PP Neue Bit', sans-serif;
            font-size: clamp(25px, 4vw, 42px);
            max-width: 600px;
            font-weight: bold;
            line-height: 1.4;
        }

        .button {
            background: #97F0E5;
            color: #0C0F1D;
            padding: 1px 50px;
            border: none;
            border-radius: 8px;
            font-size: 16px;
            cursor: pointer;
            text-decoration: none;
            transition: all 0.3s ease;
            height: 48px;
            display: flex;
            align-items: center;
            font-family: 'PP Neue Montreal', sans-serif;
        }

        .button:hover {
            background: #0C0F1D;
            color: #7ca19c;
            border: 1px solid #7ca19c;
        }

        .globe {
            position: absolute;
            bottom: -2%;
            width: 100%;
            max-width: 1200px;
            opacity: 0.75;
            pointer-events: none;
        }

        @media (max-width: 768px) {
            .content-box {
                padding: 1rem;
                min-height: 95vh;
            }
        }
    </style>
</head>
